import React from "react";
import Notes from '../Components/Notes';
import NoteItems from "./NoteItems";

const Home=()=>{
    
    return(
<>

<div className="mx-5 container" style={{width:'80%' ,display:'flex',flexDirection:'column',alignItems: 'center'}}>

<h2 className="text-center mt-4"> Add Notes</h2>



<form style={{width:'80%'}}>
  <div className="mb-3">
    <label htmlFor="exampleInputEmail1" className="form-label">Title</label>
    <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
    <div id="emailHelp" className="form-text">We'll never share your notes with anyone else.</div>
  </div>
  <div className="mb-3">
    <label htmlFor="exampleInputPassword1" className="form-label">Description</label>
    <input type="text" className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3 form-check">
    <input type="checkbox" className="form-check-input" id="exampleCheck1"/>
    <label className="form-check-label" htmlFor="exampleCheck1">Check me out</label>
  </div>
  <button type="submit" className="btn btn-primary">Submit</button>
</form>




</div>



{/* <NoteItems/> */}
<Notes/>





</>

);





}
export default Home;
